import React from "react";
import logo from "./logo.png";
import "./App.css";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Za pristup je potrebno da se ulogujete ili registrujete.
        </p>
        <button className="App-button">Login</button>
        <button className="App-button">Registracija</button>
      </header>
    </div>
  );
}

export default App;
